$(document).ready(function () {


    updateQuizResultPage();
    updateQuestionsTable();
    showQuizzes();



}); //end of document ready


function updateQuizResultPage() {
    var url = window.location.href;
    var stuff = url.split('=');
    var quiz_id = stuff[stuff.length - 1];

    $.ajax({
        type: "GET",
        url: "QuizPHPFiles/getQuizResult.php",
        data: "quiz_id=" + quiz_id,
        cache: false,
        dataType: "JSON",
        success: function (response) {
            var userScore = response['user_score'];
            var quizScore = response['score'];
            var percentage = (userScore / quizScore) * 100;

            $("#quizTitle").text(response['title'] + " Quiz Results");
            $("#score").html(userScore + "/" + quizScore);


            if (percentage >= 80) {
                $(".circlechart").text("Well done!");
            } else if (percentage < 80) {
                $(".circlechart").text("Good try!");
            }

            var description = "I got " + userScore + " out of " + quizScore + " marks for the " + response['title'] + " Quiz on Histologie!";

            $('#shareBlock').cShare({
                description: description,
                showButtons: ['fb', 'twitter', 'email']
            });

            $("#generatePDF").hover(function () {
                $(this).css({
                    '-webkit-transform': 'translateY(-4px)',
                    '-ms-transform': 'translateY(-4px)',
                    'transform': 'translateY(-4px)'
                });
            }, function () {
                $(this).css({
                    '-webkit-transform': 'translateY(0px)',
                    '-ms-transform': 'translateY(0px)',
                    'transform': 'translateY(0px)'
                });
            });




            $("#generatePDF").on("click", function () {

                var doc = new jsPDF('landscape');
                var imgData = 'data:image/png;base64,';

                doc.addImage(imgData, 'PNG', 20, 10, 80, 25);

                doc.setFontSize(50);
                doc.setTextColor("#000000");
                doc.setFontType('bold');
                doc.text(20, 70, 'Certificate of Completion');


                doc.setFontSize(10);
                doc.setTextColor("#000000");
                doc.setFontType('normal');
                doc.text(20, 100, 'Presented to:');


                doc.setFontSize(30);
                doc.setTextColor("#000000");
                doc.setFontType('normal');
                doc.text(20, 120, response['user_name']);


                doc.setFontSize(10);
                doc.setTextColor("#000000");
                doc.setFontType('normal');
                doc.text(20, 140, 'For successfully completing the:');


                doc.setFontSize(30);
                doc.setTextColor("#000000");
                doc.setFontType('normal');
                doc.text(20, 160, response['title'] + " Quiz");


                let today = new Date().toISOString().slice(0, 10);
                doc.setFontSize(10);
                doc.setTextColor("#000000");
                doc.setFontType('normal');
                doc.text(250, 200, "Date Issued: " + today);

                doc.save('histologie-result.pdf');

            });



            $(".circlechart").attr("data-percentage", Math.round(percentage));


            $('.circlechart').circlechart();


        },
        error: function (obj, textStatus, errorThrown) {
            console.log("Error " + textStatus + ": " + errorThrown);
        }
    });
}//end of updateQuizLandingPage

function showQuizzes() {
    $.ajax({
        type: "GET",
        url: "QuizPHPFiles/getQuizzes.php",
        cache: false,
        dataType: "JSON",
        success: function (response) {
            var message = "";
            for (i = 0; i < response.length; i++) {
                message += "<div class='col-sm-12 col-md-4 col-lg-4 col-xl-4 mb-5'>"
                        + "<div class='card shadow' style='width: 20rem;' id=" + response[i].quiz_id + ">"
                        + "<img class='card-img-top' src='css/img/quizImg/" + response[i].filename + "' alt='quizImage'>"
                        + "<div class='card-body'>"
                        + "<h5 class='card-title'>" + response[i].title + "</h5>"
                        + "<h6 class='card-subtitle mb-2 text-muted'>" + response[i].summary + "<br>" + response[i].questions + " Questions  | " + response[i].score + " Marks</h6>"
                        + "<a href='quizPage.php?id=" + response[i].quiz_id + "' class='btn btn-primary stretched-link'>Take Quiz</a>"
                        + "</div></div></div>";
            }
            $("#quizzesRow").html(message);
        },
        error: function (obj, textStatus, errorThrown) {
            console.log("Error " + textStatus + ": " + errorThrown);
        }
    });
}//end of showQuizzes


function updateQuestionsTable() {

    var shuffledQuestionsArr = JSON.parse(sessionStorage.getItem("shuffledQuestionsArr"));
    var questionsArr = sessionStorage.getItem("questionsArr").split("SPACE");
    var savedAnswers = JSON.parse(sessionStorage.getItem("savedAnswers"));
    var correctQ = JSON.parse(sessionStorage.getItem("correctQ"));
    var pcorrectQ = JSON.parse(sessionStorage.getItem("pcorrectQ"));


    var output = "";
    for (var i = 0; i < shuffledQuestionsArr.length; i++) {
        var status = "";
        // + "<td>" + savedAnswers[i] + "</td>"
        if (correctQ.includes(shuffledQuestionsArr[i])) {
            status = "<td class='text-success'> Correct </td>";
        } else if (pcorrectQ.includes(shuffledQuestionsArr[i])) {
            status = "<td class='text-warning'> Partially Correct </td>";
        } else {
            status = "<td class='text-danger'> Incorrect </td>";
        }

        /*
         if (userAnswer.includes(",")) {
         userAnswer = userAnswer.join();
         } 
         */
        output += "<tr><td>" + questionsArr[i] + "</td>"
                + "<td>" + savedAnswers[i]['user_answer'] + "</td>"
                + status
                + "</tr>";
    }//end of table for loop

    $("#questionsTable tbody").html(output);

}//end of updateQuestionsTable


